          </Link>
        </li>
        <li>
          <Link to='/teachers' className='text-decoration-none'>
            Teachers
          </Link>
        </li>
        <li>
          <Link to='/classes' className='text-decoration-none'>
            Classes
          </Link>
        </li>
      </ul>
    </div>
  );
}
